import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, Button, Image, SafeAreaView, Platform } from 'react-native';
import styled from 'styled-components/native';



const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingTop: Platform.OS === 'android' ? 36 : 0
  },
});



const Header = styled.View` 

   flex-direction:row;
   justify-content:space-between;
   align-items:center;
   background-color:gray;
   padding:20px;

`;


const Logo = styled.View` 

justify-content:center;

`;


const Menu = styled.View`

padding:10px;
justify-content:center;

`


const Page = styled.View` 

   flex:1;
   background-color:black;


`;

const Search = styled.View`
padding:20px;
flex-direction:row;

`;

const SearchInput = styled.TextInput`
height:50px;
outline:0;
color:white;
background-color:white;
flex:1;
border-radius:5px;
border:0;
border-radius:5px;
        outline:0;

`;


const Botao = styled.Button`
border-radius:10px;
`;


const OrganizationsList = styled.View`

`;



export default function App() {


  return (


    <SafeAreaView style={styles.container}>

      <Header>

        <Logo>

          <Image
            source={require('./assets/logotipo.png')} style={{ width: 100, height: 70 }} resizeMode="stretch"
          />

        </Logo>

        <Menu>

          <Image
            source={require('./assets/cardapio.png')} style={{ width: 40, height: 40 }} resizeMode="cover"
          />

        </Menu>


      </Header>

      <Page>

        <Search>

           <SearchInput/>

           <Botao title={<Image source={require('./assets/pesquisa.svg')} style={{ width: 30, height: 30 }} resizeMode="cover" />} />

        </Search>

        <OrganizationsList>



        </OrganizationsList>

      </Page>


    </SafeAreaView>



  )

}
